(4, 132, 'О компании', 'o-kompanii', '<p>Тут надо написать текст, который поможет клиентам познакомиться с вашей компанией поближе и заинтересоваться работать с вами. </p>\r\n<p>Текст должен содержать следующие понятия: </p>\r\n<ul>\r\n<li>Кто вы есть, работаете ли один или же с вами 300 человек (плюсом может быть и то и другое)?</li>\r\n<li>Как давно вы работаете в этой сфере?</li>\r\n<li>Даете ли гарантии на товар и свою работу?</li>\r\n<li>Непосредственная выгода работать именно с вами?</li>\r\n<li>Что клиент преобритет марального или материального, работая с вами?</li>\r\n<li>Какие бонусы и фишки вы предлагаете к развитию клиентской сети?</li>\r\n<li>Что другие ваши клиенты говорят о работе с вами? <br /><br /></li>\r\n</ul>\r\n<p>Если вы еще не знаете что писать в этом разделе, его наверно отключить вообще. Все тексты, которые пишутся на<br /> сайте, должны писаться через ценность для его читателей. </p>\r\n<p>Если вам нужна будет помощь, обращайтесь +38 (067) 268 07-35 и мы вам поможем!</p>\r\n<p>Мы в интернете: <a href="http://www.ldmco.ru" target="_blank">www.ldmco.ru</a>, <a href="http://www.zelslon.com">www.zelslon.com</a><br />Мы в вконтакте:  <a href="https://vk.com/ksenmart">https://vk.com/megamagazin<br /></a>E-mail: ksenmart@ldm-co.ru<br />Телефон: +38 (050) 268-07-35<br />Скайп: dimitriy-ldm</p>\r\n<p> </p>', '', 1, 2, '2015-06-19 15:00:18', 764, '', '2015-09-06 17:49:12', 857, 0, '0000-00-00 00:00:00', '2015-06-19 15:00:18', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 15, 3, '', '', 1, 92, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(5, 133, 'Оплата и доставка', 'oplata-i-dostavka', '<p>Раздел оплата и доставка является одним из самых важных разделов сайта, так как его посещаемость всегда на высоте.&nbsp;</p>\r\n<p>Тут нужно написать ответы на следующие вопросы:&nbsp;</p>\r\n<ul>\r\n<li>Какими методами вы доставляете товар ?</li>\r\n<li>В какие города и регионы вы готовы отправить груз и на каких условиях?</li>\r\n<li>Готовы ли вы отправлять товар за границу?</li>\r\n<li>Как происходит оплата товара?</li>\r\n<li>Есть ли гарантии?</li>\r\n<li>Что говорят о вашем сервисе доставки ваши клиенты (небольшой список отзывов об этом будет не лишним)?</li>\r\n<li>и т.д</li>\r\n</ul>\r\n<p>Написав подробно о том, как вы работаете и на каких условиях, вы будете вызывать большее доверие среди посетителей вашего сайта.&nbsp;</p>\r\n<p>Если вы еще не знаете что писать в этом разделе, его наверно тогда лучше отключить вообще. Все тексты которые пишутся на<br />сайте, должны писаться через ценность для его читателей.</p>\r\n<p>Если вам нужна будет помощь, обращайтесь&nbsp;+7 (495) 268 07-35&nbsp;и мы вам поможем!</p>\r\n<p>Мы в интернете:&nbsp;<a href="http://www.ldmco.ru" target="_blank">www.ldmco.ru</a>,&nbsp;<a href="http://www.zelslon.com">www.zelslon.com</a><br />Мы в вконтакте: &nbsp;<a href="https://vk.com/ksenmart">https://vk.com/ksenmart<br /></a>E-mail:&nbsp;ksenmart@ldm-co.ru<br />Телефон: +7 (495) 268-07-35<br />Скайп:&nbsp;dimitriy-ldm</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', '', 1, 2, '2015-06-19 15:17:11', 764, '', '2015-08-10 14:29:04', 764, 0, '0000-00-00 00:00:00', '2015-06-19 15:17:11', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 11, 2, '', '', 1, 66, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(6, 134, 'Гарантия и сервис', 'garantiya-i-servis', '<p>Раздел оплата и доставка является одним из самых важных разделов сайта, так как его посещаемость всегда на высоте.&nbsp;</p>\r\n<p>Тут нужно написать ответы на следующие вопросы:&nbsp;</p>\r\n<ul>\r\n<li>Даете ли вы гарантию на товар?</li>\r\n<li>Как гарантия распространяется на доставку?</li>\r\n<li>Есть ли страховка грузов?</li>\r\n<li>Что будет если груз потеряется?</li>\r\n<li>Как вы реагируете в сложных ситуациях, чего ждать и куда звонить?</li>\r\n<li>Срок гарантии на товары?</li>\r\n<li>Законодательные выдержки о гарантии на ваши группы товаров при торговли по интернету?</li>\r\n<li>Как быстро ответят на вопросы ваши операторы?</li>\r\n<li>Что говорят о вашем сервисе ваши клиенты (небольшой список отзывов об этом будет не лишним)?</li>\r\n<li>Сертификаты на продукцию (все или частично), чтобы подтвердить качество товара?</li>\r\n<li>и т.д</li>\r\n</ul>\r\n<p>Написав подробно о том, как и на каких условиях вы работаете, вы будете вызывать большее доверие среди посетителей вашего сайта.&nbsp;</p>\r\n<p>Если вы еще не знаете что писать в этом разделе, его лучше отключить вообще. Все тексты, которые пишутся на сайте, должны писаться через ценность для его читателей.&nbsp;</p>\r\n<p>Если вам нужна будет помощь, обращайтесь +7 (495) 268 07-35 и мы вам поможем!</p>\r\n<p>Мы в интернете: <a href="http://www.ldmco.ru" target="_blank">www.ldmco.ru</a>, <a href="http://www.zelslon.com">www.zelslon.com</a><br />Мы в вконтакте: &nbsp;<a href="https://vk.com/ksenmart">https://vk.com/ksenmart<br /></a>E-mail: ksenmart@ldm-co.ru<br />Телефон: +7 (495) 268-07-35<br />Скайп:&nbsp;dimitriy-ldm</p>', '', 1, 2, '2015-06-19 15:20:20', 764, '', '2015-08-10 14:28:54', 764, 0, '0000-00-00 00:00:00', '2015-06-19 15:20:20', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 29, 1, '', '', 1, 83, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
