(157, 136, 'Инфо в шапке (Ksenmart Colorful)', '', '<p>Пишите! <a href="mailto:operator@krotik.com.ua" rel="alternate">operator@krotik.com.ua</a> <strong><br /></strong></p>\r\n<p><span style="font-size: 10pt;">Консультация клиентов: круглосуточно</span><br /><span style="font-size: 10pt;">Время работы: Пн-Пт, 09:00 - 22:00</span></p>', 1, 'ks-clrful-header-info', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{"prepare_content":"0","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static","module_tag":"div","bootstrap_size":"0","header_tag":"h3","header_class":"","style":"0","project":null}', 0, '*'),
(158, 138, 'Инфо в подвале 1 (Ksenmart Colorful)', '', '<h5>Время работы</h5>\r\n<p>Консультация клиентов: круглосуточно<br /> Мы работаем: Пн-Пт, 09:00 - 22:00</p>', 1, 'ks-clrful-footer-info1', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{"prepare_content":"0","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static","module_tag":"div","bootstrap_size":"0","header_tag":"h3","header_class":"","style":"0","project":null}', 0, '*'),
(159, 137, 'Инфо в подвале 2 (Ksenmart Colorful)', '', '<p>Принимаем к оплате:<br /> <a href="http://www.webmoney.ru/" target="_blank"><img src="/templates/ksenmartcolorful/images/wm.png" alt="" /></a> <a href="https://money.yandex.ru/new" target="_blank"><img src="/templates/ksenmartcolorful/images/yd.png" alt="" /></a> <a href="http://visa.com.ru/ru/ru-ru/index.shtml" target="_blank"><img src="/templates/ksenmartcolorful/images/vs.png" alt="" /></a> <a href="http://www.banki.ru/wikibank/maestro/" target="_blank"><img src="/templates/ksenmartcolorful/images/mc.png" alt="" /></a></p>', 1, 'ks-clrful-footer-info2', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{"prepare_content":"0","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static","module_tag":"div","bootstrap_size":"0","header_tag":"h3","header_class":"","style":"0","project":null}', 0, '*'),
(165, 147, 'FAQ', '', '', 1, 'user1', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_codefaq', 1, 0, '{"jqueryinclude":"1","codecoloreven":"#eeeeee","codecolorhover":"#deffff","codebordercolor":"cyan","codeicons":"dark","blockstatus1":"1","question1":"Сколько товаров одновременно поддерживает Ксенмарт?","answer1":"<p><span style=\\"color: #bf572c; font-size: 14px; line-height: 20px;\\">Ксенмарт одновременно может поддерживать до 200 000 товаров. При большем количестве товарных позиций, тестирование не проводилось.<\\/span><\\/p>","blockstatus2":"1","question2":"С какой версией Joomla работает Ксенмарт?","answer2":"<p><span style=\\"color: #bf572c; font-size: 14px; line-height: 20px;\\">Последняя версия Ксенмарта 3.1.10, которая стабильно работает с Joomla 3.4.1.<\\/span><\\/p>","blockstatus3":"1","question3":"Есть ли руководство для пользователей Ксенмарта?","answer3":"<p><span style=\\"color: #bf572c; font-size: 14px; line-height: 20px;\\">Да, конечно. Скачать руководство вы можете по этой&nbsp;<\\/span><a href=\\"\\/Manual.pdf\\" target=\\"_blank\\" style=\\"color: #3f8fd2; font-size: 14px; line-height: 20px;\\">ссылке<\\/a><span style=\\"color: #bf572c; font-size: 14px; line-height: 20px;\\">.<\\/span><\\/p>","blockstatus4":"1","question4":"Как изменить логотип в шапке сайта?","answer4":"<p><span style=\\"color: #bf572c; font-size: 14px; line-height: 20px;\\">Что бы изменить логотип в шапке сайта, необходимо зайти в раздел: Расширения-&gt;Менеджер шаблонов-&gt;Выбрать соответствующий шаблон-&gt;Вкладка \\"Дополнительные параметры\\"-&gt;Пункт \\"Выберите лого\\".<\\/span><\\/p>","blockstatus5":"1","question5":"Каким образом и как часто происходит обновление Ксенмарта?","answer5":"<p><span style=\\"color: #bf572c; font-size: 14px; line-height: 20px;\\">Обновления Ксенмарта выпускается, в среднем, раз в месяц. Скачать и установить обновление можно в административной панеле Joomla.<\\/span><\\/p>","blockstatus6":"0","question6":"","answer6":"","blockstatus7":"0","question7":"","answer7":"","blockstatus8":"0","question8":"","answer8":"","blockstatus9":"0","question9":"","answer9":"","blockstatus10":"0","question10":"","answer10":"","blockstatus11":"0","question11":"","answer11":"","blockstatus12":"0","question12":"","answer12":"","blockstatus13":"0","question13":"","answer13":"","blockstatus14":"0","question14":"","answer14":"","blockstatus15":"0","question15":"","answer15":"","blockstatus16":"0","question16":"","answer16":"","blockstatus17":"0","question17":"","answer17":"","blockstatus18":"0","question18":"","answer18":"","blockstatus19":"0","question19":"","answer19":"","blockstatus20":"0","question20":"","answer20":"","layout":"_:default","moduleclass_sfx":"","owncache":"1","module_tag":"div","bootstrap_size":"0","header_tag":"h3","header_class":"","style":"0","project":null}', 0, '*'),
