(25, 201, 'Условия доставки', 'usloviya-dostavki', '<h3>Стоимость доставки по Виннице:</h3>\r\n<p>Заказы до 500 грн - по тарифу службы такси <br />Заказы от 500грн - бесплатно</p>\r\n<h3>Оплата</h3>\r\n<p>Оплата заказа производится при получении заказа (обычно шашлык привозит таксист).</p>\r\n<h3>Сроки доставки</h3>\r\n<p>Мы готовим не только вкусно, но и быстро. Время доставки заказа с момента его поступления составляет от 25 до 40 минут.</p>\r\n<h3>Прием заказов</h3>\r\n<p>Мы принимаем заказы с 9.00 до 21.00. Заказать доставку можно по телефонам 0987995999 и 0631935864.</p>', '', 1, 2, '2016-03-20 19:36:13', 461, '', '2016-03-20 19:46:52', 461, 0, '0000-00-00 00:00:00', '2016-03-20 19:36:13', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 10, 0, '', '', 1, 2740, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', '');
