(80, 0, 'Овощи на мангале(сезонное)', '<p>Конечно же, шашлык - это очень вкусное блюдо. Но и оно зачастую требует приятного гарнира. Тем более, очень часто оказывается, что за столом присутствуют вегетарианцы. В данном случае один из лучших способов решения проблемы - заказать в Виннице овощи на мангале. Они отличаются невероятным вкусом. Вам абсолютно не обязательно отправляться на рынок. Вам привезут уже готовое блюдо в максимально сжатые сроки.</p>', -1, 'product_80', 1, 536, 1458504062, 0, 0, 0, 11, 'main', 0, 0, '', '0.000', '', 'kg', 1542714716, '', 'm', '0.000', '0.000', '0.000', 0, 'all', '', 0, 0, 0, 1542703208, 0, 0, '', 0, 0, '', 'ovoshchi-na-mangale', '0.0000000', '0.0000000', '', 0, ''),
(81, 0, 'Шампиньоны на мангале', '<p>Один из самых полезных продуктов это запеченные овощи, они оставляют в себе почти все витамины. Что бы отведать вкусных шампиньонов на мангале, можно заказать в Виннице доставку домой. Грибы могут быть самостоятельным блюдом или станут отличным дополнением к гарниру. Изумительный вкус не оставит равнодушным даже кулинарного гурмана. А гарантия качества и свежесть приготовления заставит каждый ломтик таять во рту.</p>', -1, 'product_81', 1, 553, 1458504128, 0, 0, 0, 11, 'main', 0, 0, '', '0.000', '', 'kg', 1542714453, '', 'm', '0.000', '0.000', '0.000', 0, 'all', '', 0, 0, 0, 1542705883, 0, 0, '', 0, 0, '', 'shampinony-na-mangale', '0.0000000', '0.0000000', '', 0, ''),
(82, 0, 'Coca Cola', '', -1, 'Coca_Cola', 1, 345, 1458559421, 0, 0, 0, 11, 'main', 0, 0, '', '0.000', '', 'kg', 1523822146, '', 'm', '0.000', '0.000', '0.000', 0, 'all', '', 0, 0, 0, 1542670166, 0, 0, '', 0, 0, '', 'coca-cola', '0.0000000', '0.0000000', '', 0, ''),
(77, 0, 'Долма Армянская', '<p>Такое изысканное и домашнее блюдо, как долма армянская не может остаться незамеченным на столе. Аппетитные голубцы, одетые в виноградные листья очень вкусны и красивы на вид. Мясная начинка приправленная ароматными специями и травами не оставит равнодушным ни одного ценителя национальной армянской кухни. <br />Это блюдо можно заказать в Виннице и насладиться его пряным ароматом и нежным вкусом в одиночку, а еще лучше в компании родных и близких людей.</p>', -1, 'product_77', 1, 440, 1458503991, 0, 0, 0, 11, 'main', 0, 0, '', '0.000', '', 'kg', 1459088195, '', 'm', '0.000', '0.000', '0.000', 0, 'all', '', 0, 0, 0, 1542125435, 0, 0, '', 0, 0, '', 'dolma-armyanskaya', '0.0000000', '0.0000000', '', 0, ''),
(78, 0, 'Картошка с салом на мангале', '<p>Квалифицированные повара нашей компании постоянно рекомендуют один проверенный вариант. Самую лучшую, качественную картошку нарезают удобными для приготовления кусочками. Тонкими ломтиками режут свиное соленое сало. Из данных продуктов поочередно составляют "пирамидку" на шампуре, заворачивают в фольгу. Этот вкусный и полезный "кебаб" готовится на мангале, обязательно нужен достаточный жар. Дальше блюдо запекается необходимое время, а практичнее всего заказать в Виннице, не пожалеете.</p>', -1, 'product_78', 1, 517, 1458504020, 0, 0, 0, 11, 'main', 0, 0, '', '0.000', '', 'kg', 1542714355, '', 'm', '0.000', '0.000', '0.000', 0, 'all', '', 0, 0, 0, 1542706092, 0, 0, '', 0, 0, '', 'kartoshka-s-salom-na-mangale', '0.0000000', '0.0000000', '', 0, ''),
(79, 0, 'Лаваш с сыром', '<p>Лаваш с сыром - универсальное блюдо, которая подойдет хоть какому столу, будь то праздничный стол или просто семейный ужин. Для изготовления предоставленной закуски, мы используем классический рецепт лаваша и мягкий сыр. У нас постоянно лишь свежие и полезные продукты. Заказать угощение в Виннице можно ежедневно. Операторы примут и оформят заявку на дом либо в офис. Сроки нашей доставки, более короткие, как в городе, так и ежели Вы сами стали ее приготовлять. Заказывать пищу на дом всегда рентабельно, а с нами еще и надежно!</p>', -1, 'product_79', 1, 581, 1458504039, 0, 0, 0, 11, 'main', 0, 0, '', '0.000', '', 'kg', 1542714381, '', 'm', '0.000', '0.000', '0.000', 0, 'all', '', 0, 0, 0, 1542703270, 0, 0, '', 0, 0, '', 'lavash-s-syrom', '0.0000000', '0.0000000', '', 0, ''),
(73, 0, 'Скумбрия на мангале', '<p>Предлагаем разнообразить Ваше рыбное меню ароматной и мегаполезной скумбрией приготовленной на мангале. Теперь этот кладезь витаминов можно заказать в Виннице. Скумбрия - чудесный вариант для тех кто соблюдает правильное питание и здоровый образ жизни. Мы, заботясь о Вашем здоровье, максимально сохранили все витамины и микроэлементы, которыми так богата скумбрия. Это блюдо станет незаменимой частью вашего обеда в офисе или семейного ужина.</p>', -1, 'product_73', 1, 581, 1458503790, 0, 0, 0, 11, 'main', 0, 0, '', '0.000', '', 'kg', 1542714209, '', 'm', '0.000', '0.000', '0.000', 0, 'all', '', 0, 0, 0, 1542703127, 0, 0, '', 0, 0, '', 'skumbriya-na-mangale', '0.0000000', '0.0000000', '', 0, ''),
(71, 0, 'Люля-кебаб из Телятины', '<p>У вас вечеринка, торжественное событие или просто перекус в офисе? <br /><br />Наши повара с удовольствием побалуют вас нежнейшим люля-кебаб из высококачественной телятины. Мясное блюдо, распространённое на Кавказе, в Средней Азии сейчас можно заказать в Виннице, наша служба доставки сделает все, чтобы вы получили люля-кебаб из свежей телятины в удобное время, в любом районе города.<br />Готовые люля-кебаб вам привезут с зеленью и вашим любимым соусом быстро и в срок. <br /><br />Приятного вам аппетита!</p>', -1, '________-________________________________', 1, 576, 1458503602, 0, 0, 0, 11, 'main', 0, 0, '', '0.000', '', 'kg', 1542713768, '', 'm', '0.000', '0.000', '0.000', 0, 'all', '', 0, 0, 0, 1542705930, 0, 0, '', 0, 0, '', 'lyulya-kebab-iz-telyatiny', '0.0000000', '0.0000000', '', 0, ''),
(72, 0, 'Люля-кебаб из Баранины  ', '<p>Люля-кебаб из курицы нельзя отнести к традиционным кавказским блюдам, но, тем не менее, блюдо это имеет восточный колорит. Наш повар знает, какие специи и травы нужно добавить в фарш, чтобы люля-кебаб получился сочным и ароматным. Хрустящая корочка образуется на блюде при обжарке на углях. Заказать в Виннице люля-кебаб из курицы стоит тем, кто свинине и баранине предпочитает более нежное и диетичное мясо.</p>', -1, '________-____________________________', 1, 785, 1458503615, 0, 0, 0, 11, 'main', 0, 0, '', '0.000', '', 'kg', 1542713751, '', 'm', '0.000', '0.000', '0.000', 0, 'all', '', 0, 0, 0, 1542633489, 0, 0, '', 0, 0, '', 'lyulya-kebab-iz-kuritsy', '0.0000000', '0.0000000', '', 0, ''),
(70, 0, 'Перепела на мангале  100ГР', '<p>Мясо перепела очень вкусное, нежное и считается самым диетическим из всех мясных блюд. Приготовление перепела на мангале в ароматных специях с хрустящей зажаренной корочкой, дополнит любой праздничный стол, а также подойдёт для лёгкого, но в тоже время сытного обеда. Сочного перепела на мангале, вы сможете заказать в Виннице. Почувствуйте изумительный вкус мясного деликатеса, приготовленному по изысканному рецепту.</p>', -1, 'product_70', 1, 521, 1458503589, 0, 0, 0, 11, 'main', 0, 0, '', '0.000', '', 'kg', 1542713802, '', 'm', '0.000', '0.000', '0.000', 0, 'all', '', 0, 0, 0, 1542700604, 0, 0, '', 0, 0, '', 'perepelka', '0.0000000', '0.0000000', '', 0, ''),
(69, 0, 'Крыло Куриное 100ГР', '', -1, 'product_69', 1, 544, 1458503561, 0, 0, 0, 11, 'main', 0, 0, '', '0.000', '', 'kg', 1523824177, '', 'm', '0.000', '0.000', '0.000', 0, 'all', '', 0, 0, 0, 1542713342, 0, 0, '', 0, 0, '', 'krylo-kurinoe', '0.0000000', '0.0000000', '', 0, ''),
(68, 0, 'Бедро Куриное 100ГР', '<p>Предлагаем вашим изысканным кулинарным желаниям шикарный шашлык из куриного бедра, нежно порубленного на небольшие кусочки. Вы можете прямо сейчас заказать в Виннице вкуснейший шашлык из курицы как со шкуркой, так и без нее, в первом случае более жирный вариант, с добавлением лука, чеснока, зелени, соли и перца по вкусу. Также хотим обратить внимание на фирменный рецепт куриного шашлыка в маринаде на основе майонеза, что дает курице удивительно нежный вкус.</p>', -1, 'product_68', 0, 479, 1458503550, 0, 0, 0, 11, 'main', 0, 0, '', '0.000', '', 'kg', 1523822460, '', 'm', '0.000', '0.000', '0.000', 0, 'all', '', 0, 0, 0, 1523671455, 0, 0, '', 0, 0, '', 'bedro-kurinoe', '0.0000000', '0.0000000', '', 0, ''),
(66, 0, 'Шашлык из Телятины 100ГР', '<p>Шашлык – это блюдо, которое возможно приготовить из различных сортов мяса, но особенно нежным оно будет если использовать для его приготовления мясо телёнка. Популярность к телятине во всем мире пришла благодаря своей нежности и быстроте приготовления. Вам не придётся долго мариновать телятину, так как мясо телёнка очень нежное.<br />У вас совершенно нет свободного времени, а гости уже на пороге? Вы можете шашлык из телятины заказать в Виннице. Используя только свежайшее мясо телёнка, наши повара, при помощи вкуснейших маринадов создадут тот неповторимый и изысканный вкус настоящего шашлыка.</p>', -1, 'product_66', 1, 576, 1458503528, 0, 0, 0, 11, 'main', 0, 0, '', '0.000', '', 'kg', 1523824272, '', 'm', '0.000', '0.000', '0.000', 0, 'all', '', 0, 0, 0, 1542669227, 0, 0, '', 0, 0, '', 'shashlyk-iz-telyatiny', '0.0000000', '0.0000000', '', 0, ''),
(67, 0, 'Ребро Свиное 100ГР', '<p>Шашлык из свиных ребер — сочный, ароматный, нежный. Что может быть вкусней этого блюда? В ребрышках присутствует немного жира благодаря которому образуется хрустящая, румяная корочка на шашлыке. Хорошая совокупность жирного и постного мяса в одном кусочке шашлыка, что придется любому по вкусу. Мясо отлично промариновано и обладает восхитительным ароматом. Мясистые, безумно вкусно приготовленные ребрышки можно заказать в Виннице!</p>', -1, 'product_67', 1, 549, 1458503540, 0, 0, 0, 11, 'main', 0, 0, '', '0.000', '', 'kg', 1542713508, '', 'm', '0.000', '0.000', '0.000', 0, 'all', '', 0, 0, 0, 1542535417, 0, 0, '', 0, 0, '', 'rebro-svinoe', '0.0000000', '0.0000000', '', 0, ''),
(65, 0, 'Чалагач (стейк из свинины на кости) 100 гр', '<p>Чалагач - это шашлык из свинины, а именно из реберной части тушки. Мясо на кости чаще всего получается более ароматным и аппетитным, нежели без оной. Чалагач - Армянское блюдо, его можно приготовить, как на огне, так и в духовке. В любом случае, мясо получается превосходным. <br />Заказать и полакомиться таким угощеньем можно в Виннице. Из отборной свинины местные повара приготовят и подадут вам сытный обед.</p>', -1, 'product_65', 1, 1620, 1458503514, 0, 0, 0, 11, 'main', 0, 0, '', '0.000', '', 'kg', 1542713390, '', 'm', '0.000', '0.000', '0.000', 0, 'all', '', 0, 0, 0, 1542703356, 0, 0, '', 5, 1, '', 'chalagach-stejk-iz-svininy-na-kosti', '0.0000000', '0.0000000', '', 0, ''),
(64, 0, 'Шашлык из свинины (Ошеек) 100 гр', '<p>Свиная шея – это самая мягкая и нежная часть животного, без жил, мускул с небольшими жировыми прослойками. Такой шашлык из ошейка самый популярный среди любителей мяса на мангале. Благодаря оригинальному маринаду наш шашлык получается в меру пряным и очень сочным. Каждый может попробовать и заказать доставку в Виннице этого превосходного готового мяса. Вкуснейший, ароматный горячий шашлык прямо с мангала не оставит никого равнодушным, вы вкусно и сытно накормите маленькую и большую компанию.</p>', -1, 'product_1', 1, 1142, 1458503373, 0, 0, 0, 11, 'main', 0, 0, '', '0.000', '', 'kg', 1542712940, '', 'm', '0.000', '0.000', '0.000', 0, 'all', '', 0, 0, 0, 1542649389, 0, 0, '', 5, 1, '', 'shashlyk-iz-oshejka', '0.0000000', '0.0000000', '', 0, ''),
