(12, 470, 'AnthonyJer', 'm', 'As you will inevitably learn on your path to losing weight, effective weight loss is not only about watching what you eat, but much more about changing your lifestyle. This means changing your habits and how you approach your day-to-day life. Read this information to help you throughout the process.', '', 'https://www.acheterviagrafr24.com/', 1, '', '37.115.188.176', '37-115-188-176.broadband.kyivstar.net', ''),
(13, 471, 'Timothyvus', 'm', 'Has your snoring prevented you from getting good sleep for years? If you have not seen a doctor about this issue, you might be experiencing a dangerous and serious form of snoring associated with sleep apnea. If this rings true, then try not worry!. The article below can help. \r\n \r\nIf you suffer from sleep apnea, you should use a Continuous Positive Airway Pressure machine while sleeping. This will help you treat your sleep apnea and get you on the path to having a full nights sleep. This machine uses either a face or nasal mask to pump air while you sleep. \r\n \r\nConsider doing a few very specific exercises before going to bed each night, to alleviate some of your sleep apnea symptoms. Exercising throat and tongue muscles has been proven in scientific studies to reduce snoring, improve breathing and lessen the more profound effects of sleep apnea when done according to doctor''s orders. \r\n \r\nAvoid drinking alcohol to excess. Your muscles are relaxed by drinking alcohol. You may want to feel more relaxed, but it can exacerbate your apnea. When your throat muscles relax, your airway narrows and causes sleep apnea. If you''re not going to give up alcohol, then just don''t do it right before bedtime. \r\n \r\nIf you are taking a great deal of medicines on a regular basis, sit with your doctor and discuss how they can be reduced. Side effects from prescription medication can be making your sleep apnea worse. Keep a dialog open with your doctor and make sure he is up to date on all your symptoms. \r\n \r\nTo help diagnose your sleep apnea, your doctor may ask you to keep a sleep log. This log is where you''ll keep track of how much you sleep during the night, and other symptoms you may experience. Your partner can let you know if you snore too loudly, jerk your limbs, or stop breathing. Your doctor will then be able to tell if you suffer from sleep apnea. \r\n \r\nWeight loss can be a big help for those that suffer from sleep apnea. The condition is common in overweight patients that have larger neck circumferences. Losing weight can significantly reduce the pressure on your airway and improve the flow of air as you breathe at night. \r\n \r\nA great way to know if you are experiencing severe apnea is to keep a sleep journal. Write down all the times that you wake up in the night and also record how you feel in the morning. This will help you to have a record to see your progress. \r\n \r\nIf simple changes in your lifestyle, such as regular sleep hours and losing weight, have not eliminated your sleep apnea episodes, it is time to consult with a sleep specialist. The specific causes of your sleep apnea can be evaluated, and an individual treatment plan can be designed for you. \r\n \r\nSleep apnea can cause many problems beyond just the inability to get a good night''s sleep. If you let your condition go untreated, it may get worse over time. Getting enough sleep is crucial to your overall level of health, so start using the tips you have read in this article right away to find relief. \r\n \r\n<a href="https://www.viagrasansordonnancefr.com/">viagrasansordonnancefr.com</a>', '', 'https://www.viagrasansordonnancefr.com/', 1, '', '46.119.116.110', '46-119-116-110.broadband.kyivstar.net', ''),
